// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract Punch is ERC20 {
  address constant FOX = 0x8A98cb0Eb880E791902eee7E92EFA16Bd06412bb;
  address constant LAURENCE = 0xAdf189887c7AF2FDF8B83Abfc1e10C409675A9e6;
  address constant KOZLAV = 0x1fBf24a56A77a40e9dbB9155822FC13b23Ed2958;

  constructor() ERC20("Punch", "PUNCH") {
    // dev fund - Fox
    _mint(FOX, 7500 * (10 ** uint256(decimals())));

    // dev fund - Laurence
    _mint(LAURENCE, 2500 * (10 ** uint256(decimals())));

    // tg admin - Kozlav
    _mint(KOZLAV, 1000 * (10 ** uint256(decimals())));

    // liqudity + farming + reserve
    _mint(msg.sender, 89000 * (10 ** uint256(decimals())));
  }
}
